import axios from "axios";
import React from "react";
import { useState, useEffect } from "react";
import { useCurrent } from "../hook/current";
import { useMaster } from "../hook/incomes";

const Receivablechecks = () => {
  const [incomes, setIncomes] = useState([]);
  const [ordering, setOrdering] = useState("-date");
  const access = localStorage.getItem("access");
  const [title, setTitle] = useState();
  const [amount, setAmount] = useState();
  const [description, setDescription] = useState();
  const [flag, setTest] = useState(false);

  const [tag, setTag] = useState("food");

  const { data } = useMaster(flag);
  const { data: current } = useCurrent();

  
  useEffect(() => {
    fetch(`/api/incomes/?ordering=${ordering}`)
      .then((res) => res.json())
      .then((res) => {
        setIncomes(res);
      });
  }, [ordering]);

  const handleSubmit = (e) => {
    e.preventDefault();
    axios
      .post(
        "http://127.0.0.1:8000/api/dashboard/account/",
        {
          user_id: current.id,
          title: title,
          description: description,
          amount: amount,
          is_checked: "true",

          typ: "output",
          tag: tag,
        },
        {
          headers: {
            "Content-Type": "application/json",
            accept: "application/json",
            Authorization: `Bearer ${access}`,
            "X-CSRFToken":
              "gnu99yM7oNaRBL4Pjcs88CeWmxOWW55xf2lf1E7Hyzm4UlIZKCkYRI3RL9nTjwm5",
          },
        }
      )
      .then((result) => {
        setTest(!flag);
        alert("submit"+"  " +title)
      })
      .catch((error) => {
        alert("fill all of data");

      });
    localStorage.setItem("flag", "true");
  };

  const handleDelete = (e) => {
    axios
      .delete(
        `http://127.0.0.1:8000/api/dashboard/account/${e}/`,

        {
          headers: {
            "Content-Type": "application/json",
            accept: "application/json",
            Authorization: `Bearer ${access}`,
          },
        }
      )
      .then((result) => {
        setTest(!flag);
        alert("remove ");

      })
      .catch((error) => {
        alert("نام کاربری و یا رمز عبور اشتباه است لطفا مجدد تلاش کنید.");
      });
  };

  return (
    <div className="p-4">
      <h1>Returnable Checks</h1>
      <div className="row">
        <div className="col-12 my-4">
          <div className="card">
            <div className="card-header">New Returnable Checks</div>
            <div className="card-body">
              <form onSubmit={handleSubmit}>
                <div className="form-group">
                  <label htmlFor="amount">title</label>
                  <input
                    onChange={(e) => setTitle(e.target.value)}
                    name="amount"
                    className="form-control"
                    id="amount"
                    placeholder="Enter amount"
                  />
                  <label htmlFor="amount">Amount</label>
                  <input
                    onChange={(e) => setAmount(e.target.value)}
                    type="number"
                    name="amount"
                    className="form-control"
                    id="amount"
                    placeholder="Enter amount"
                  />
                  <label htmlFor="amount">description</label>
                  <input
                    onChange={(e) => setDescription(e.target.value)}
                    name="description"
                    className="form-control"
                    id="description"
                    placeholder="Enter description"
                  />
                </div>
                <label htmlFor="description">tag</label>
                <select
                  value={tag}
                  onChange={(e) => setTag(e.target.value)}
                  className="form-select form-select-lg"
                  aria-label=".form-select-lg example"
                >
                  <option value="food">food</option>
                  <option value="dress">dress</option>
                  <option value="bill">bill</option>
                  <option value="rent">rent</option>
                  <option value="leon">leon</option>
                  <option value="salary">salary</option>
                  <option value="cars and accessories">
                    cars and accessories
                  </option>
                  <option value="payment to other"> payment to other</option>
                  <option value="service">service</option>
                  <option value="health">health</option>
                  <option value="other">other</option>
                </select>
                <button type="submit" className="m-2 btn btn-outline-primary">
                  submit
                </button>
              </form>
            </div>
          </div>
        </div>
        <div className="col-12">
          <div className="card">
            <div className="card-header d-flex">
              Returnable Checks
              <div className="input-group mb-3 w-25 ms-auto"></div>
            </div>
            <div className="card-body">
              <ul className="list-group">
                <table className="w-full table-auto">
                  <thead className="bg-gray-50">
                    <tr className="text-xs font-medium text-gray-500 uppercase tracking-wider">
                      <th className="px-6 py-3 text-left">Title</th>
                      <th className="px-6 py-3 text-left">Description</th>
                      <th className="px-6 py-3 text-left">Amount</th>
                      <th className="px-6 py-3 text-left">Tag</th>
                      <th className="px-6 py-3 text-left">Created At</th>
                      <th className="px-6 py-3 text-left"></th>
                    </tr>
                  </thead>
                  <tbody className="bg-white divide-y divide-gray-200">
                    {data
                      .filter((i) => i.typ === "output")
                      .filter((i) => i.is_checked !== false)
                      .map((item) => (
                        <tr key={item.id} className="hover:bg-gray-100">
                          <td className="px-6 py-4 whitespace-nowrap">
                            <div className="text-sm font-medium text-gray-900">
                              {item.title}
                            </div>
                          </td>
                          <td className="px-6 py-4 whitespace-nowrap">
                            <div className="text-sm text-gray-500 truncate w-96">
                              {item.description}
                            </div>
                          </td>
                          <td className="px-6 py-4 whitespace-nowrap">
                            <div className="text-sm font-medium text-gray-900">
                              ${item.amount}
                            </div>
                          </td>
                          <td className="px-6 py-4 whitespace-nowrap">
                            <span className="px-2 inline-flex text-xs leading-5 font-semibold rounded-full bg-blue-100 text-blue-800">
                              {item.tag}
                            </span>
                          </td>
                          <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                            {new Date(item.created_at).toLocaleDateString()}
                          </td>
                          <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                            <button
                              onClick={() => handleDelete(item.id)}
                              className=" me-4 btn btn-danger btn-sm"
                            >
                              Delete<i className="bi bi-trash"></i>
                            </button>
                          </td>
                        </tr>
                      ))}
                  </tbody>
                </table>
              </ul>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Receivablechecks;
